function App() {
  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">Tours of Colors</Navbar.Brand>
        </Container>
      </Navbar>

      <Container>

      </Container>
    </div>
  );
}

export default App;
